# No associative arrays available in bash 3 (used by CentOS 5), so we have to work around this using regular arrays
find_version_rhel_hash() {
    local version=$1

    for hash in ${rhel_hashes[@]}; do
        found=$(echo "$hash" | grep --color=never "$version")
        if [ -n "$found" ]; then
            # Extract the part after the second colon
            echo "${found#*:*:}"
            break
        fi
    done
}

find_version_suse_hash() {
    local version=$1

    for hash in ${suse_hashes[@]}; do
        found=$(echo "$hash" | grep --color=never "$version")
        if [ -n "$found" ]; then
            # Extract the part after the second colon
            echo "${found#*:*:}"
            break
        fi
    done
}

if ! command -v rpm >/dev/null; then
    echo "[ INFO ] rpm not present on the host, nothing to check."
    exit 0
fi

get_non_datadog_packages() {
    # Suffix package names with : to not match packages that are superstrings of known packages
    # : is not allowed in package names, so it should be safe to use
    read -d "\n" -r -a packages_suffixed <<< ${datadog_packages[@]/%/:}
    # grep --color=never -v ${packages_suffixed[@]/#/-e } will be rendered as:
    # grep --color=never -v -e <package name 1>: -e <package name 2>: ...
    # which will exclude all lines that contain one of the package names
    packages_string=$(rpm -qa --qf '%{NAME}:%{VERSION}-%{RELEASE} %{SIGPGP:pgpsig} %{SIGGPG:pgpsig}\n' | grep --color=never $datadog_fingerprint | grep --color=never -v ${packages_suffixed[@]/#/-e } | cut -d ' ' -f1)
    read -d "\n" -r -a packages <<< $packages_string

    if [ -n "$packages" ]; then
        echo "[ ERROR ] Found ${#packages[@]} untracked packages signed with key $datadog_fingerprint."
        echo "[ ERROR ] Full package list:"
        for package in ${packages[@]}; do
            echo "[ ERROR ]   $package"
        done
        status=1
    else
        echo "[ OK ] No untracked packages signed with key $datadog_fingerprint found."
    fi
}

check_datadog_package() {
    local package_name=$1
    # Suffix package names with : to not match packages that are superstrings of known packages
    # : is not allowed in package names, so it should be safe to use
    datadog_package_version=$(rpm -qa --qf '%{NAME}:%{VERSION}-%{RELEASE}.%{ARCH}\n' | grep --color=never "$package_name:")

    if [ -z "$datadog_package_version" ]; then
        # No version installed
        return
    fi

    datadog_package_hash=$(rpm -q --qf "%{SIGGPG}\n" "$package_name")
    datadog_package_expected_rhel_hash=$(find_version_rhel_hash "$datadog_package_version")
    datadog_package_expected_suse_hash=$(find_version_suse_hash "$datadog_package_version")

    echo "[ INFO ] Found installed $datadog_package_version"

    if [ -n "$datadog_package_expected_rhel_hash" ] || [ -n "$datadog_package_expected_suse_hash" ]; then
        if [ "$datadog_package_hash" = "$datadog_package_expected_rhel_hash" ] || [ "$datadog_package_hash" = "$datadog_package_expected_suse_hash" ]; then
            # The package version is one of the versions signed with the old key, and the hash matches what we expect
            echo "[ OK ] The $datadog_package_version package hash matches its expected value."
            return
        else
            echo "[ ERROR ] The $datadog_package_version package doesn't match a known package tracked by this script."
            echo "[ ERROR ] Computed hash: $datadog_package_hash"
            echo "[ ERROR ] Expected hash(es):"
            echo "[ ERROR ]   $datadog_package_expected_rhel_hash"
            echo "[ ERROR ]   $datadog_package_expected_suse_hash"
            status=1
            return
        fi
    else
        if [ "$datadog_package_hash" = "(none)" ]; then
            # Versions signed with new keys should return "(none)" for their hash, as they are not signed with a DSA key
            echo "[ OK ] The $datadog_package_version package hash matches its expected value."
            return
        else
            echo "[ ERROR ] The $datadog_package_version package doesn't match a known package tracked by this script."
            echo "[ ERROR ] Computed hash: $datadog_package_hash"
            status=1
            return
        fi
    fi
}

echo "[ INFO ] Script version $script_version"

get_non_datadog_packages
for package in ${datadog_packages[@]}; do
    check_datadog_package $package
done

if [ "$status" -gt "0" ]; then
    echo "[ ERROR ] Please contact Datadog support: https://www.datadoghq.com/support/, and attach the output of this script."
fi

exit $status
